import Container from "../components/Container";
import Button from "../components/ButtonCreate";
import Link from "next/link";
const Index = () => {
  return (
    <Container>
      <h1>Hola</h1>
      <Link href={"/create"}>
        <Button />
      </Link>
    </Container>
  );
};

export default Index;
